<!DOCTYPE html>
<html>

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        :root {
            --bg-color: #1b1b22;
            --green: #ffffff;
        }

        * {
            box-sizing: border-box;
        }

        body {
            margin: 0;
            padding: 0;
            place-content: center;
            text-align: center;
            background: #fff;
            color: #fff;
            box-sizing: border-box;
            font-size: 16px;
        }

        .content_img {
            display: flex;
            justify-content: center;
            flex-direction: column;
        }

        .content_img .pdf_img {
            max-width: 800px;
            margin: 0 auto;
        }

        .content_img .pdf_img img {
            width: 100%;
        }

        #myAudio {
            margin: 0;
            background: #f1f3f4;
            width: 100%;
            position: fixed;
            bottom: 0;
            left: 0;
            right: 0;
        }

        #myAudio audio {
            width: 100%;
        }
    </style>
 </head>
